    let pages = [];
    for (let i = 0; i <= pagesCount; i++) {
        pages.push(i);
    }
     return (
        <div>
        <div>
        <Paginator
               users={props.users}
               page={props.page}
               pageCount={props.pageCount}
               totalUsersCount={props.totalUsersCount}
               getItems = {props.getItems}
               appointAnExecutor={props.appointAnExecutor} />
        </div>
    </div>
  )
}

export default Items;
